import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/pages/Home'
import {Sw,Route} from 'react-router-dom'
function App() {
  return (
    <> 
      <Navbar/>
      <Routes>
        <Route path='/' element={<Home/>} />
      </Routes>

    </>
  );
}

export default App;
